import pytest
import inspect
import solution_543
from collections import deque


def tn(items: list[int]) -> solution_543.TreeNode:
    """
    From a list of values, create a TreeNode
    Source: https://stackoverflow.com/questions/43097045/best-way-to-construct-a-binary-tree-from-a-list-in-python
    """
    # this code does not generate treenodes in leetcode's style (with None)
    n = len(items)
    if n == 0:
        return None

    def inner(index: int = 0) -> solution_543.TreeNode:
        """Closure function using recursion bo build tree"""
        if n <= index or items[index] is None:
            return None

        node = solution_543.TreeNode(items[index])
        node.left = inner(2 * index + 1)
        node.right = inner(2 * index + 2)
        return node

    return inner()


@pytest.mark.timeout(3)
@pytest.mark.parametrize("f", [f[1] for f in inspect.getmembers(solution_543, predicate=inspect.isfunction)])
def test_example_1(f):
    """
    ![https://assets.leetcode.com/uploads/2021/03/06/diamtree.jpg](https://assets.leetcode.com/uploads/2021/03/06/diamtree.jpg)

    Explanation: 3 is the length of the path [4,2,1,3] or [5,2,1,3].
    """
    root = tn([1, 2, 3, 4, 5])
    output = 3

    assert f(root) == output


